import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

// Interface for client data
interface Client {
  id: number;
  first_name: string;
  last_name: string;
  email: string;
  phone?: string;
  date_of_birth?: string;
  programs: { id: number; name: string }[];
}

// Interface for program data
interface Program {
  id: number;
  name: string;
  description?: string;
}

const App: React.FC = () => {
  // State for authentication, clients, programs, and form inputs
  const [clients, setClients] = useState<Client[]>([]);
  const [programs, setPrograms] = useState<Program[]>([]);
  const [searchQuery, setSearchQuery] = useState('');
  const [selectedClient, setSelectedClient] = useState<Client | null>(null);
  const [token, setToken] = useState('');
  const [loginCredentials, setLoginCredentials] = useState({ username: '', password: '' });
  const [newClient, setNewClient] = useState({
    first_name: '',
    last_name: '',
    email: '',
    phone: '',
    date_of_birth: ''
  });
  const [newProgram, setNewProgram] = useState({ name: '', description: '' });
  const [enrollProgramId, setEnrollProgramId] = useState('');

  // Login to obtain JWT token
  const handleLogin = async () => {
    try {
      const response = await axios.post('http://localhost:5000/api/login', loginCredentials);
      setToken(response.data.access_token);
    } catch (error) {
      alert('Login failed');
    }
  };

  // Fetch programs
  useEffect(() => {
    if (token) {
      axios.get('http://localhost:5000/api/programs', {
        headers: { Authorization: `Bearer ${token}` }
      }).then(response => setPrograms(response.data));
    }
  }, [token]);

  // Fetch clients based on search query
  useEffect(() => {
    if (token) {
      axios.get(`http://localhost:5000/api/clients/search?q=${searchQuery}`, {
        headers: { Authorization: `Bearer ${token}` }
      }).then(response => setClients(response.data));
    }
  }, [searchQuery, token]);

  // Register new client
  const handleRegisterClient = async () => {
    try {
      await axios.post('http://localhost:5000/api/clients', newClient, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setNewClient({ first_name: '', last_name: '', email: '', phone: '', date_of_birth: '' });
      alert('Client registered');
    } catch (error) {
      alert('Failed to register client');
    }
  };

  // Create new program
  const handleCreateProgram = async () => {
    try {
      await axios.post('http://localhost:5000/api/programs', newProgram, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setNewProgram({ name: '', description: '' });
      alert('Program created');
    } catch (error) {
      alert('Failed to create program');
    }
  };

  // Enroll client in program
  const handleEnrollClient = async (clientId: number) => {
    try {
      await axios.post(`http://localhost:5000/api/clients/${clientId}/programs`, 
        { program_id: parseInt(enrollProgramId) }, 
        { headers: { Authorization: `Bearer ${token}` } }
      );
      alert('Client enrolled');
    } catch (error) {
      alert('Failed to enroll client');
    }
  };

  // View client profile
  const handleViewProfile = async (clientId: number) => {
    try {
      const response = await axios.get(`http://localhost:5000/api/clients/${clientId}`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setSelectedClient(response.data);
    } catch (error) {
      alert('Failed to fetch profile');
    }
  };

  // Login screen
  if (!token) {
    return (
      <div className="min-h-screen bg-gray-100 flex items-center justify-center">
        <div className="bg-white p-8 rounded-lg shadow-lg w-full max-w-md">
          <h2 className="text-2xl font-bold mb-6 text-center">Login</h2>
          <input
            type="text"
            placeholder="Username"
            value={loginCredentials.username}
            onChange={e => setLoginCredentials({ ...loginCredentials, username: e.target.value })}
            className="w-full p-2 mb-4 border rounded"
          />
          <input
            type="password"
            placeholder="Password"
            value={loginCredentials.password}
            onChange={e => setLoginCredentials({ ...loginCredentials, password: e.target.value })}
            className="w-full p-2 mb-4 border rounded"
          />
          <button
            onClick={handleLogin}
            className="w-full bg-blue-600 text-white p-2 rounded hover:bg-blue-700"
          >
            Login
          </button>
        </div>
      </div>
    );
  }

  // Main dashboard
  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <div className="container mx-auto">
        <h1 className="text-3xl font-bold mb-6 text-center">Health Information System</h1>

        {/* Search Clients */}
        <div className="bg-white p-6 rounded-lg shadow-lg mb-6">
          <h2 className="text-xl font-semibold mb-4">Search Clients</h2>
          <input
            type="text"
            value={searchQuery}
            onChange={e => setSearchQuery(e.target.value)}
            placeholder="Search by name or email..."
            className="w-full p-2 border rounded mb-4"
          />
          <table className="w-full border-collapse border">
            <thead>
              <tr className="bg-gray-200">
                <th className="border p-2">ID</th>
                <th className="border p-2">Name</th>
                <th className="border p-2">Email</th>
                <th className="border p-2">Actions</th>
              </tr>
            </thead>
            <tbody>
              {clients.map(client => (
                <tr key={client.id}>
                  <td className="border p-2">{client.id}</td>
                  <td className="border p-2">{client.first_name} {client.last_name}</td>
                  <td className="border p-2">{client.email}</td>
                  <td className="border p-2">
                    <button
                      onClick={() => handleViewProfile(client.id)}
                      className="bg-blue-600 text-white px-2 py-1 rounded hover:bg-blue-700"
                    >
                      View Profile
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        {/* Register Client */}
        <div className="bg-white p-6 rounded-lg shadow-lg mb-6">
          <h2 className="text-xl font-semibold mb-4">Register Client</h2>
          <input
            type="text"
            placeholder="First Name"
            value={newClient.first_name}
            onChange={e => setNewClient({ ...newClient, first_name: e.target.value })}
            className="w-full p-2 border rounded mb-4"
          />
          <input
            type="text"
            placeholder="Last Name"
            value={newClient.last_name}
            onChange={e => setNewClient({ ...newClient, last_name: e.target.value })}
            className="w-full p-2 border rounded mb-4"
          />
          <input
            type="email"
            placeholder="Email"
            value={newClient.email}
            onChange={e => setNewClient({ ...newClient, email: e.target.value })}
            className="w-full p-2 border rounded mb-4"
          />
          <input
            type="text"
            placeholder="Phone"
            value={newClient.phone}
            onChange={e => setNewClient({ ...newClient, phone: e.target.value })}
            className="w-full p-2 border rounded mb-4"
          />
          <input
            type="date"
            value={newClient.date_of_birth}
            onChange={e => setNewClient({ ...newClient, date_of_birth: e.target.value })}
            className="w-full p-2 border rounded mb-4"
          />
          <button
            onClick={handleRegisterClient}
            className="w-full bg-blue-600 text-white p-2 rounded hover:bg-blue-700"
          >
            Register Client
          </button>
        </div>

        {/* Create Program */}
        <div className="bg-white p-6 rounded-lg shadow-lg mb-6">
          <h2 className="text-xl font-semibold mb-4">Create Program</h2>
          <input
            type="text"
            placeholder="Program Name"
            value={newProgram.name}
            onChange={e => setNewProgram({ ...newProgram, name: e.target.value })}
            className="w-full p-2 border rounded mb-4"
          />
          <textarea
            placeholder="Description"
            value={newProgram.description}
            onChange={e => setNewProgram({ ...newProgram, description: e.target.value })}
            className="w-full p-2 border rounded mb-4"
          />
          <button
            onClick={handleCreateProgram}
            className="w-full bg-blue-600 text-white p-2 rounded hover:bg-blue-700"
          >
            Create Program
          </button>
        </div>

        {/* Enroll Client */}
        <div className="bg-white p-6 rounded-lg shadow-lg mb-6">
          <h2 className="text-xl font-semibold mb-4">Enroll Client in Program</h2>
          <select
            value={enrollProgramId}
            onChange={e => setEnrollProgramId(e.target.value)}
            className="w-full p-2 border rounded mb-4"
          >
            <option value="">Select Program</option>
            {programs.map(program => (
              <option key={program.id} value={program.id}>{program.name}</option>
            ))}
          </select>
          <button
            onClick={() => selectedClient && handleEnrollClient(selectedClient.id)}
            className="w-full bg-blue-600 text-white p-2 rounded hover:bg-blue-700"
            disabled={!selectedClient || !enrollProgramId}
          >
            Enroll Selected Client
          </button>
        </div>

        {/* Client Profile */}
        {selectedClient && (
          <div className="bg-white p-6 rounded-lg shadow-lg">
            <h2 className="text-xl font-semibold mb-4">Client Profile</h2>
            <p><strong>Name:</strong> {selectedClient.first_name} {selectedClient.last_name}</p>
            <p><strong>Email:</strong> {selectedClient.email}</p>
            <p><strong>Phone:</strong> {selectedClient.phone || 'N/A'}</p>
            <p><strong>Date of Birth:</strong> {selectedClient.date_of_birth || 'N/A'}</p>
            <p><strong>Programs:</strong> {selectedClient.programs.map(p => p.name).join(', ') || 'None'}</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default App;
